# 流(stream)
关于Nodejs的标签有*异步的*，*事件驱动的*...
流是异步的

# 什么是流数据？
文档中关于流的介绍有这么一段话>A stream is an abstract interface for working with streaming data in Node.js
那什么是```streaming data```呢？动态、持续生成的数据。见参考文档。

# 关于Nodejs的stream模块
提供流数据操作的抽象api。

# 部件：流的源，流的目标，缓存（缓冲）
1. 各部件怎么协作的？ 

# 数据块
write, end方法第一个参数是数据块

# 可写流API
## cork
可以分批执行缓存。跟uncork成对操作。
## uncork

# 可读流API
>只有提供了消费或忽略数据的机制后，可读流才会产生数据。
有消费才有生成。
 

