# 事件
## data事件
当流转换到 flowing 模式时会触发data事件，
在流处于处态时绑定data事件会切换流状态为flowing，进而触发data事件（这只是触发事件方式之一）。

1. 多个data事件回调函数接收的参数是一样的。
2. 

## end事件
流没有数据后触发

## readable事件
事件表明流有了新的动态：要么是有了新的数据，要么是到了流的尾部

？是表示流是否数据还是表示缓存池是否有数据
? 处理 'readable'事件可能造成吞吐量升高

## close & error事件

